        let oxyGenN = { x: 18, y: 18 };

        const grid = [];
        const beens = JSON.parse(beensString);
        beens.forEach(a => {
            if (!grid.some(b => b.x == a.x && b.y == a.y) && (a.x != 0 || a.y != 0)) {
                grid.push({ x: a.x, y: a.y, type: "path" });
            }
        });

        //walls.forEach(a => {

        //        grid.push({ x: a.x, y: a.y, type: "walls" });
        //    }
        //});
        if (grid.findIndex(a => a.x == oxyGenN.x && a.y == oxyGenN.y) >= 0) {
            const i = grid.findIndex(a => a.x == oxyGenN.x && a.y == oxyGenN.y);
            grid.splice(i, 1);
        }
        grid.push({ x: oxyGenN.x, y: oxyGenN.y, type: "destination" });
        grid.push({ x: 0, y: 0, type: "origin" });


        let pre = document.createElement("PRE");
        document.body.appendChild(pre);

        const minX = -21;
        const maxX = 20;
        const minY = -21;
        const maxY = 20;

        const draw = function () {
            let str = "";
            for (let y = minY; y <= maxY; y++) {
                for (let x = minX; x <= maxX; x++) {
                    if (grid.some(a => a.x == x && a.y == y && a.type == "destination")) {
                        str += "@";
                    } else if (x == 0 && y == 0) {
                        str += "D";
                    } else if (grid.some(a => a.x == x && a.y == y && a.type == "path" && a.intersection == true)) {
                        const g = grid.find(a => a.x == x && a.y == y && a.type == "path" && a.intersection == true)
                        str += String.fromCharCode(g.intersectionLabel);
                    } else if (grid.some(a => a.x == x && a.y == y && a.type == "path")) {
                        str += ".";
                    } else {
                        str += " ";
                    }
                }
                str += "\n";
            }
            pre.innerHTML = str;
        }

        draw();

        const start = grid.find(a => a.type == "origin");
        start.type == "path";
        start.intersection = true;
        start.intersectionLabel = 35;

        const end = grid.find(a => a.type == "destination");
        end.type == "path";
        end.intersection = true;
        end.intersectionLabel = 36;

        let intersectionCount = 37;
        const findIntersection = function (grid) {
            grid.forEach(a => {
                if (grid.filter(b =>
                    (a.x == b.x && a.y == b.y - 1) ||
                    (a.x == b.x && a.y == b.y + 1) ||
                    (a.x == b.x - 1 && a.y == b.y) ||
                    (a.x == b.x + 1 && a.y == b.y)).length > 2) {
                    a.intersection = true;
                    a.intersectionLabel = intersectionCount;
                    intersectionCount++;
                }
            });
        }
        findIntersection(grid);

        draw();


        const getDistances = function (grid) {
            grid.filter(a => a.intersection).forEach(a => {
                const x = a.x;
                const y = a.y;
                getOptionsForItem(a, grid, { x: a.x, y: a.y });
            })
        }

        const getOptionsForItem = function (item, grid, amAt, wasAt = null, moved = 0) {
            const movements = [{ x: 1, y: 0 }, { x: 0, y: 1 }, { x: -1, y: 0 }, { x: 0, y: -1 }];
            movements.forEach(a => {
                const wouldBeAt = { x: amAt.x + a.x, y: amAt.y + a.y };
                if (wasAt != null && wouldBeAt.x == wasAt.x && wouldBeAt.y == wasAt.y) {
                    // NOT possible
                } else if (grid.find(a => a.x == wouldBeAt.x && a.y == wouldBeAt.y) != null) {
                    // possible
                    const n = grid.find(a => a.x == wouldBeAt.x && a.y == wouldBeAt.y);
                    if (n.intersectionLabel != null) {
                        if (item.distances == null) item.distances = {};
                        if (item.distances[n.intersectionLabel] != null) {
                            if (item.distances[n.intersectionLabel] > moved + 1) {
                                item.distances[n.intersectionLabel] = moved + 1;
                            }
                        } else {
                            item.distances[n.intersectionLabel] = moved + 1;
                        }
                    } else {
                        // Keep moving
                        getOptionsForItem(item, grid, wouldBeAt, amAt, moved + 1);
                    }
                } else {
                    // NOT possible
                }
            })

        }
        getDistances(grid);


        const options = [];
        const getRoutes = function (portals, from, to, soFar = [], incomingLength = 0) {
            if (options.some(a => a.length < incomingLength)) return;
            soFar = [...soFar];
            soFar.push({ p: from });
            const starts = portals.filter(a => a.intersectionLabel == from);
            starts.forEach(start => {
                let length = incomingLength;
                const connectedToStart = Object.keys(start.distances).filter(a => a != "AA");
                if (connectedToStart.some(a => a == to)) {
                    options.push({ route: [...soFar, { p: to }], length: length + start.distances[to] });
                }
                const moreOptions = connectedToStart.filter(a => !patternFound(soFar, a) && a != to);
                moreOptions.forEach(a => {
                    getRoutes(portals, a, to, soFar, length + start.distances[a]);
                });
            });
        }

        const patternFound = function (arr, extra) {
            var newArray = arr.map(function (o, i) {
                if (i < arr.length - 1) {
                    return arr[i].p + "|" + arr[i + 1].p;
                }
            });
            newArray.push(arr[arr.length - 1].p + "|" + extra);
            newArray.sort();
            newArray = newArray.filter(function (o, i) {
                if (i < arr.length - 1) {
                    return (o == newArray[i + 1]);
                }
            });
            return newArray.length > 0;
        }

        const getExpansion = function (portals, from, soFar = [], incomingLength = 0) {
            //if (options.some(a => a.length < incomingLength)) return;
            const me = portals.find(a => a.intersectionLabel == from);
            if (me.oxygen == true && portals.filter(a => !a.oxygen).length == 0) {
                options.push({ route: [...soFar], length: incomingLength });
                return;
            }
            if (me.oxygen == true) {
                return;
            }
            me.oxygen = true;
            soFar = [...soFar];
            soFar.push({ p: Number(from) });
            const starts = portals.filter(a => a.intersectionLabel == Number(from));
            starts.forEach(start => {
                let length = incomingLength;
                const connectedToStart = Object.keys(start.distances);
                const moreOptions = connectedToStart.filter(a => !patternFound(soFar, a));
                moreOptions.forEach(a => {
                    getExpansion(portals, a, soFar, length + start.distances[Number(a)]);
                });
            });
        }
